import React from 'react';

class OrderForm extends React.Component {
  handleChange = e => {
    // console.log({value: e.target.value})

    this.setState({
      orderCode: e.target.value,
    })
  };

  handleClick = e => {
    console.log("click")
  };


  render() {
    return(
      <div>
        <h1>New order</h1>

        <form>
          <div className="form-group">
            <label>Order Code</label>
            <input onChange={this.handleChange} className="form-control" type="text" name="orderCode" />
          </div>

          <div className="form-group">
            <label>Order Name</label>
            <input onChange={this.handleChange} className="form-control" type="text" name="orderName" />
          </div>

          <div className="form-group">
            <label>Order App</label>
            <input onChange={this.handleChange} className="form-control" type="text" name="orderApp" />
          </div>
        </form>

        <button onClick={this.handleClick} className="btn btn-primary">Save</button>
      </div>
    )
  }
};

export default OrderForm;
